import React from 'react'
import Navbar from '../components/navbar/navbar'
import Sidebar from '../components/sidebar/sidebar'


const sidebar_options = {
    marginTop: {
        marginTop: "2vh"
    },
    blank: false,
    blocks: {
        item1: {
            title: "Add Movie",
            link: "/createMovie"
        },
        item2: {
            title: "View Movie",
            link: "/viewMovie"
        },
        item3: {
            title: "Multi view",
            link: "/multiview"
        }
    }

}

const MultiViewPage = () => {
    return(
        <React.Fragment>
            <Navbar />
            <Sidebar input={sidebar_options}/>
        </React.Fragment>
    );
}

export default MultiViewPage
